INSERT INTO `faq` (`faq_id`,`content`,`title`,`faq_category_id`) VALUES (4,'마이페이지 첫 화면에서 해당 예약 수정 버튼을 클릭하시거나 고객센터(1111-1111)로 문의하시면 변경하실 수 있습니다.','예약 날짜를 변경하는 방법. ',3);
