INSERT INTO `faq` (`faq_id`,`content`,`title`,`faq_category_id`) VALUES (7,'탈퇴 즉시 고객님의 개인정보는 모두 삭제됩니다.<br>단, 전자상거래 및 소비자 권리 보호를 위해 개인정보 외의 거래정보 등은 법률에서 정한 기간 동안 보관될 수 있습니다.','탈퇴시 개인정보는 모두 삭제 되나요?',4);
INSERT INTO `faq` (`faq_id`,`content`,`title`,`faq_category_id`) VALUES (8,'아이핀으로 본인확인 후 비밀번호 변경이 가능합니다.<br>아이핀이 없으신 경우, 아이핀 사이트에서 신규발급이 가능합니다.<br>KISA 아이핀사이트 : <a href=\'http://i-pin.kisa.or.kr/kor/main.jsp\'>http://i-pin.kisa.or.kr/kor/main.jsp</a>','포인트의 유효기간은 얼마인가요?',4);
INSERT INTO `notice` (`notice_id`,`content`,`create_date`,`last_update_date`,`title`,`view_count`) VALUES (1,'당사는 2023년 3월 13일 자로 아래와 같이 개인정보 처리방침을 개정 운영할 예정이오니,\r<br>변경 사항을 확인하시어 이용에 불편 없으시길 바랍니다.\r<br>\r<br><개인정보 처리방침 개정>\r<br>\r<br>● 개정 조항: 제10조 (개인정보의 위탁처리)\r<br>\r<br>● 변경 내용 : 위탁업체 삭제\r<br>\r<br>위탁업체 : (주)얼리슬로스 / 위탁업무 내용 : 고객 설문조사 및 응답 분석\r<br>\r<br>감사합니다.\r<br>','2023-03-28 17:22:22.595408','2023-03-28 17:22:22.595408','이용약관 및 개인정보처리방침 개정 안내',1);
